import React from 'react';

export const Notes = ({ notes }) => {
    return (
        <div>
            <ul class="list-group">
                {notes.map(note => (
                    <li
                        class="list-group-item note"
                        key={note.id}>
                        <div>
                            <strong>{note.title}</strong>
                            <small>{new Date(Date.parse()).toLocaleDateString()}</small>
                        </div>
                        <button
                            type="button"
                            class="btn btn-outline-danger btn-sm"
                        >&times;</button>
                    </li>))}
            </ul>
        </div>
    );
}
